#include <vector>
#include <string>
#include <unordered_map>
#include <algorithm>
using namespace std;

class Solution {
public:
    vector<string> findHighAccessEmployees(vector<vector<string>>& access_times) {
        unordered_map<string, vector<int>> employee_access;
        for (const auto& entry : access_times) {
            int time = stoi(entry[1].substr(0, 2)) * 60 + stoi(entry[1].substr(2, 2));
            employee_access[entry[0]].push_back(time);
        }

        vector<string> result;
        for (auto& [employee, times] : employee_access) {
            sort(times.begin(), times.end());
            for (int i = 0; i < times.size(); ++i) {
                int count = 1;
                for (int j = i + 1; j < times.size() && times[j] - times[i] < 60; ++j) {
                    count++;
                }
                if (count >= 3) {
                    result.push_back(employee);
                    break;
                }
            }
        }
        return result;
    }
};
